import React from 'react';
import {SidebarContainer, Icon, CloseIcon, SidebarWrapper, SidebarMenu, SidebarLink} from './MobileNavElements';

const MobileNav = () => {
  return (

    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>

      <SidebarWrapper>

        <SidebarMenu>
          <SidebarLink to="learnMore">Learn More</SidebarLink>
          <SidebarLink to="projects">Our Projects</SidebarLink>
          <SidebarLink to="members">Meet the Members</SidebarLink>
          <SidebarLink to="FAQ">FAQ</SidebarLink>
        </SidebarMenu>

      </SidebarWrapper>
    </SidebarContainer>
  )
}

export default MobileNav;
